import Header from "./components/Header";
import TaskList from "./components/TaskList";
import "./App.css";

const App = () => {
  const [tasks, setTasks] = useState([
    { id: "1", taskName: "sad", deadline: "safc", status: "safc" },
  ]);

  return (
    <div>
      <Header />
      if(tasks.length ?
      <table>
        <thead>
          <tr>
            <td>Id</td>
            <td>Name</td>
            <td>Deadline</td>
            <td>Status</td>
          </tr>
        </thead>
        <tbody>
          {tasks.map((task) => (
            <TaskList
              id={task.id}
              name={task.taskName}
              deadline={task.deadline}
              status={task.status}
            />
          ))}
        </tbody>
      </table>
      : null )
    </div>
  );
};

export default App;
